import './Company.css'

function Company({name,value}) {
  const [profit,setProfit] = useState(true)  

  return (
    <div className='box'>
    <div className='left'></div>
    <div className='right'>
        <span className='name'>{name} </span>
        <span className='value'>{value>0?setProfit(true):setProfit(false)}%</span>
    </div>

    </div>
  )
}

export default Company
